package com.gromoks.container.testdata;

public class DataTypeHolder {
    private int intType;
    private double doubleType;
    private long longType;
    private boolean booleanType;

    private Integer integerType;
    private Double doubleBigType;
    private Long longBigType;
    private Boolean booleanBigType;
    private String stringType;

    private EmailService emailService;

    public int getIntType() {
        return intType;
    }

    public void setIntType(int intType) {
        this.intType = intType;
    }

    public double getDoubleType() {
        return doubleType;
    }

    public void setDoubleType(double doubleType) {
        this.doubleType = doubleType;
    }

    public long getLongType() {
        return longType;
    }

    public void setLongType(long longType) {
        this.longType = longType;
    }

    public boolean getBooleanType() {
        return booleanType;
    }

    public void setBooleanType(boolean booleanType) {
        this.booleanType = booleanType;
    }

    public Integer getIntegerType() {
        return integerType;
    }

    public void setIntegerType(Integer integerType) {
        this.integerType = integerType;
    }

    public Double getDoubleBigType() {
        return doubleBigType;
    }

    public void setDoubleBigType(Double doubleBigType) {
        this.doubleBigType = doubleBigType;
    }

    public Long getLongBigType() {
        return longBigType;
    }

    public void setLongBigType(Long longBigType) {
        this.longBigType = longBigType;
    }

    public Boolean getBooleanBigType() {
        return booleanBigType;
    }

    public void setBooleanBigType(Boolean booleanBigType) {
        this.booleanBigType = booleanBigType;
    }

    public String getStringType() {
        return stringType;
    }

    public void setStringType(String stringType) {
        this.stringType = stringType;
    }

    public EmailService getEmailService() {
        return emailService;
    }

    public void setEmailService(EmailService emailService) {
        this.emailService = emailService;
    }

}
